import React from "react";
import "../styles/login.css";
import "../styles/inputField/inputField1.css";
import logo from "../assets/logo.svg";
import { useFormik } from "formik";

function LogIn() {
  const initialValues = {
    email: "",
    password: "",
  };

  const logIn = () => {
    const { values, errors, touched, handleBlur, handleChange, handleSubmit } =
      useFormik({
        initialValues: initialValues,
        onSubmit: (values) => {
          console.log(values);
        },
      });
  };

  return (
    <>
      <div className="mainbg">
        <div className="left">
          <div className="logo">
            <img src={logo} alt="" />
          </div>
          <div className="form-section">
            <div className="welcometext">WELCOME BACK</div>
            <form>
              <input type="text" name="email" placeholder="Email" />
              <input
                type="password"
                autoComplete="off"
                name="password"
                placeholder="Password"
              />
              <button type="submit">Log In</button>
            </form>

            <p>
              Already have an account? <a href="/signup">SignUp</a>
            </p>
          </div>
        </div>
        <div className="right">
          <p>Where Comfort Meets Convenience:</p>
          <p>Explore Your Dream Residence Today</p>
        </div>
      </div>
    </>
  );
}

export default LogIn;
